import React, { useState } from 'react';
import './App.css';
import DonationTracker from './components/DonationTracker';
import PostingApp from './components/PostingApp';

function App() {
  const [activeTab, setActiveTab] = useState<'donations' | 'posts'>('donations');

  return (
    <div className="App">
      <header className="App-header">
        <h1>Tralelero</h1>
        <p>A community for sharing and giving</p>
      </header>

      <div className="app-tabs">
        <button 
          className={`tab-button ${activeTab === 'donations' ? 'active' : ''}`}
          onClick={() => setActiveTab('donations')}
        >
          Donations
        </button>
        <button 
          className={`tab-button ${activeTab === 'posts' ? 'active' : ''}`}
          onClick={() => setActiveTab('posts')}
        >
          Tralelero Tralala
        </button>
      </div>

      <main>
        {activeTab === 'donations' ? <DonationTracker /> : <PostingApp />}
      </main>
    </div>
  );
}

export default App;
